class IntroText {
  constructor(id, title, subtitle, color, imageUrlDesktop, ) {
    this.id = id;
    this.title = title;
    this.subtitle = subtitle;
    this.color = color;
    this.imageUrlDesktop = imageUrlDesktop;
    this.imageUrlMobile = imageUrlMobile;
  }
}

export default IntroText;
